// Adjustments for "We Specialize In" hover functionality
$(document).ready(function () {
    // Select all hover elements
    const hoverElements = $('.hover-image'); // Adjust selector if necessary

    // Ensure proper initial state
    hoverElements.css('color', 'grey');

    // Clear existing hover bindings to avoid conflicts
    hoverElements.off('mouseenter mouseleave');

    // Add hover handlers
    hoverElements.on('mouseenter', function () {
        $(this).css({
            color: 'blue', // Change to blue on hover
            transition: 'color 0.3s ease' // Smooth transition
        });
        $(this).text('Hovered!'); // Update text on hover
    });

    hoverElements.on('mouseleave', function () {
        $(this).css({
            color: 'grey', // Reset to grey on hover out
            transition: 'color 0.3s ease' // Smooth transition
        });
        $(this).text('We Specialize In'); // Reset text on hover out
    });

    console.log('Hover functionality adjusted and applied successfully.');
});
